function Navbar() {
    return(
        <div className='border rounded-md px-3 bg-blue-500 py-3 shadow grid grid-cols-2 text-white'>
            <p className=''>Logo</p>
            <ul className='list-none flex flex-row justify-end space-x-3 '>
                <li><a href="#">Home</a></li>
                <li><a href="#">Products</a></li>
                <li><a href="#">Team</a></li>
                <li><a href="#">Contacts</a></li>
            </ul>
        </div>
    )
}

export default Navbar;
